import React from "react";

function CollectionPreview(props) {
  return (
    <div>
      {props.collections.map(collection => (
        <div key={collection.id}>
          <h1>{collection.title}</h1>
          {collection.items.map(item => (
            <div key={item.id}>
              <h3>{item.name}</h3>
            </div>
          ))}
        </div>
      ))}
    </div>
  );
}

export default CollectionPreview;
